import React, {Component} from 'react';
import {Menu} from "antd";
import {AppstoreAddOutlined, MailOutlined, UsergroupAddOutlined} from "@ant-design/icons";


import navStyle from './index.module.css';

const {SubMenu}=Menu;

class Nav extends Component {
    render() {
        return (
            <div className={navStyle.frame}>
                <Menu theme='dark' mode='inline' style={{fontSize:'16px',fontWeight:'500'}}>
                    <SubMenu key='enterprise' title='企业管理' icon={<AppstoreAddOutlined style={{fontSize:'16px'}}/>}>
                        <Menu.Item key='sign'>企业注册</Menu.Item>
                        <Menu.Item key='update'>企业变更</Menu.Item>
                    </SubMenu>
                    <SubMenu key='role' title='角色管理' icon={<UsergroupAddOutlined style={{fontSize:'16px'}}/>}>
                        <Menu.Item key='create'>创建角色</Menu.Item>
                        <Menu.Item key='accredit'>授权管理</Menu.Item>
                    </SubMenu>
                    <SubMenu key='broadcast' title='消息推送' icon={<MailOutlined style={{fontSize:'16px'}}/>}>
                        <Menu.Item key='post'>新建推送</Menu.Item>
                        <Menu.Item key='feedback'>消息管理</Menu.Item>
                    </SubMenu>
                </Menu>
            </div>
        );
    }
}

export default Nav;
